    id AS sale_row_id,
    product_id,
    quantity_sold,
    original_price AS unit_original_price,
    final_price AS unit_final_price,
    (original_price * (quantity_sold)::numeric) AS line_original_total,
    discount_amount,
    total_sale AS line_final_total,
    profit,
    payment_method,
    sold_by,
    created_at
   FROM public.sales
  ORDER BY created_at DESC;


