--
-- TOC entry 360 (class 1259 OID 25396)
-- Name: sales_receipts; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.sales_receipts AS
 SELECT transaction_id,
    min(created_at) AS created_at,
    max(sold_by) AS sold_by,
    max(payment_method) AS payment_method,
    count(*) AS line_count,
    sum(quantity_sold) AS total_items,
    sum((original_price * (quantity_sold)::numeric)) AS gross_before_discounts,
    sum(discount_amount) AS total_discount,
    sum(total_sale) AS net_total,
    sum(profit) AS total_profit
   FROM public.sales
  GROUP BY transaction_id
  ORDER BY (min(created_at)) DESC;


